import React from "react";
import { Router , Route } from "react-router-dom";

const abc =()=>{
  console.log("ell")
}

const App =()=>{
    return(
        <>
           <Router>
             <Route path="/" Component={abc}/>
           </Router>
          <h1>Belymon Infotech</h1>
        </>
    )
}

export default App;
